def selection_sort(a):
    n = len(a)
    for i in range(0, n - 1):
        min_idx = i
        for j in range(i + 1, n):
            if a[j] < a[min_idx]:
                min_idx = j
        a[i], a[min_idx] = a[min_idx], a[i]

def insert_sort(a):
    n = len(a)
    for i in range(1, n):
        key = a[i]
        j = i - 1
        while j >= 0 and a[j] > key:
            a[j + 1] = a[j]
            j -= 1
        a[j + 1] = key

def bubble_sort(a):
    n = len(a)
    while True:
        changed = False
        for i in range(0, n-1):
            if a[i] > a[i + 1] :
                a[i], a[i + 1] = a[i + 1], a[i]
                changed = True
        if changed == False:
            return

def quick_sort_sub(a, start, end):
  if end - start <= 0:
    return

  pivot = a[end]
  i = start
  for j in range(start, end):
    if a[j] <= pivot:
      a[i], a[j] = a[j], a[i]
      i += 1
  a[i], a[end] = a[end], a[i]

  quick_sort_sub(a, start, i - 1)
  quick_sort_sub(a, i + 1, end)

def quick_sort(a):
  quick_sort_sub(a, 0, len(a) - 1)
